import React, { useEffect } from "react";
import { useSelector } from "react-redux";

import classes from "./KeysList.module.css";
import Key from "./Key";

const KeysList = () => {
  const keys = useSelector((state) => state.keys.keys);

  useEffect(() => {
    const sendRequest = async () => {
      const response = await fetch(
        "https://keysee-default-rtdb.firebaseio.com/keys.json",
        {
          method: "PUT",
          body: JSON.stringify({ keys: keys.keys }),
        }
      );
    };
  }, []);

  return (
    <ul className={classes.keys__list}>
      {keys.map((key) => (
        <Key key={key.id} id={key.id} content={key.content} />
      ))}
    </ul>
  );
};

export default KeysList;
